import React, { useState, useEffect } from 'react'
import axios from 'axios'
const Home = () => {
  const [portfolios, setPortfolios] = useState([])
  useEffect(() => {
    const fetchProtfolios = async () => {
      const { data } = await axios.get('/api/portfolios')
      setPortfolios(data)
    }
    fetchProtfolios()
  }, [])
  return <div></div>
}

export default Home
